class AddTodo extends Component {
    state = {
        taskName: 'wow'
    }
  render() {
    return (
      <form>
        <input
        type = 'text'
        name = 'title'
        placeholder = 'Add Task'
        value = { this.state.taskName}
        />
        <input 
        type = 'submit' 
        value =' Add' />
      </form>
    )
  }
}

export default  AddTodo;
